# HeapSort
def Heapify(A, n, i):
    najwieksza = i
    lewo = 2 * i + 1
    prawo = 2 * i + 2
    if lewo < n and A[i] < A[lewo]:
        najwieksza = lewo
    if prawo < n and A[najwieksza] < A[prawo]:
        najwieksza = prawo
    if najwieksza != i:
        A[i], A[najwieksza] = A[najwieksza], A[i]
        Heapify(A, n, najwieksza)


def Heap_Sort(A):

    n = len(A)
    for i in range(n // 2 - 1, -1, -1):
        Heapify(A, n, i)
    for i in range(n - 1, 0, -1):
        A[i], A[0] = A[0], A[i]
        Heapify(A, i, 0)


startH = time.time()
Heap_Sort(A)
endH = time.time()
print("HeapSort: ", endH - startH)



